import './App.css';
import { getCards } from './api';
import DataLoader from './components/DataLoader';
import Slider from './components/Slider';
import Card from './components/Card';

function App(props) {
  return (
    <Slider>
      <DataLoader loadData={getCards} render={Card} />
    </Slider>
  );
}

export default App;
